import React from 'react';

import { BannerContainer, BannerTextBackgroundGreen, BannerTextBackgroundRed, BannerText } from './banner.styles';
import { CustomButton } from './../custom-button/custom-button.component';


const Banner = () => (
  <BannerContainer>
    <BannerTextBackgroundGreen>
      <BannerText>Download a Price Sheet Today!</BannerText>
      <CustomButton>Get Pricing</CustomButton>
    </BannerTextBackgroundGreen>
  </BannerContainer>

);

export default React.memo(Banner);
